sources.Login_Page\\CSS\\3_Join.scss:
* {padding: 0; margin: 0;
  font-family: 'Noto Sans KR', sans-serif;}
li {list-style: none;}
a {text-decoration: none;
color: #000;
display: block;}
/* ===================== */

.warp {
  position: relative;
}




/* Header =================================== */

$PointColor: #002053;
$SmallFont : 14px;
$MidleFont : 16px;
$LageFont : 18px;
$TitFont : 32px;

#header {
  position: absolute;
  left: 0;
  top: 0;
  z-index: 10;
  width: 100%;
  height: 100px;
  background-color: #fff;

  .header_outer{
    width: 100%;
    height: 100px;
  }

  .header_box {
    display: flex;
    width: 1660px;
    height: 100px;
    margin: 0 auto;
    flex-direction: row;
    justify-content: space-between;
    margin-top: 0.5px;

    .logo {
      width: 150px;
      height: 100px;
      line-height: 105px;
      text-align: center;
      padding: 10px;
      box-sizing: border-box;
    }

    .sht_header .each_menu_ul,
    .mainMenu .mainMenu_ul {
      width: 400px;
      height: 100px;
      display: flex;
      justify-content: space-between;
      align-items: center;
      font-size: 20px;
      font-weight: bold;

      li:nth-child(4) {
        width: 1px;
        height: 15px;
        border-right: 1px solid #000;
        box-sizing: border-box;
      }

      li {
        height: 100px;
        line-height: 100px;
      }

      a {
        color: #000;
        display: block;
      }
    }
  }
}


/* GNB ========== */
#header .gnb {
  .gnb_box {
    .gnb_Menu {
      width: 220px;
      height: 100px;
      display: flex;
      flex-wrap: wrap;
      flex-direction: row;
      justify-content: space-around;
      align-items: center;

      .gnb_Menu_map picture {
        padding: 5px;
        text-align: center;
      }
    }
  }
}



/* 메인 메뉴 SHEET HEADER 영역*/
.mainMenu_Sheet {
  position: absolute;
  top: 0.5px;
  left: 0;
  z-index: 100;
  width: 100%;
  height: 105vh;
  display: flex;
  justify-content: center;
  /* background 블러처리 */
  background-color: rgba(0, 0, 0, 0.1);
  backdrop-filter: blur(8px);

  .main_menu_sht_outer {
    width: 100%;
    height: 65vh;
    background-color: #fff;
    display: flex;
    justify-content: center;

    .main_menu_sht {
      display: flex;
      z-index: 100;
      flex-direction: row;
      flex-wrap: wrap;
      justify-content: center;
      width: 1660px;
      height: 65vh;
      background-color: #fff;
      background-blend-mode: hue;

      /* SHEET 메뉴 영역 */
      .sht_header {
        display: flex;
        width: 1660px;
        height: 100px;
        margin: 0 auto;
        flex-direction: row;
        justify-content: space-between;
        box-sizing: border-box;

        .sht_logo {
          width: 150px;
          height: 100px;
          line-height: 105px;
          text-align: center;
          padding: 10px;
          box-sizing: border-box;
        }

        .each_menu_ul {
          width: 400px;
          height: 100px;
          display: flex;
          justify-content: space-between;
          align-items: center;
          font-size: 20px;
          font-weight: bold;

          li {
            height: 25px;
            line-height: 25px;
          }

          // sheet 메뉴 상단 hover color 변경
          li:hover {
            border-bottom: 2px solid $PointColor;
            box-sizing: border-box;
          }
        }

        .sht_gnb_Menu {
          width: 220px;
          height: 100px;
          display: flex;
          flex-wrap: wrap;
          flex-direction: row;
          justify-content: space-around;
          align-items: center;

          .sht_gnb_Menu_map picture {
            padding: 5px;
            text-align: center;
          }
        }
      }
    }
  }
}


/* SHEET 영역 내 HEADER li(bar) 영역*/
.mainMenu_Sheet {
  .main_menu_sht {
    .sht_header {
      .each_menu_ul {
        li {
          a {
            color: #000;
          }
        }

        li:nth-child(4) {
          position: relative;
          z-index: -1;
          display: block !important;
          width: 1px;
          height: 15px;
          border-right: 1px solid #000;
          box-sizing: border-box;
        }
      }
    }
  }
}



/* SHEET MENU LIST BOX (맨앞,맨뒤영역)*/
.sheet_box {
  width: 1660px;
  position: absolute;
  top: 100px;
  display: flex;

  .sht_firstBox,
  .sht_lastBox {
    display: flex;
    width: 13.3333%;
    height: 500px;
    flex-direction: row;
    flex-wrap: wrap;
    box-sizing: border-box;
    align-content: flex-start;
    padding: 30px 20px;
    box-sizing: border-box;

    li:first-child {
      width: 100%;
      height: 50px;
      line-height: 35px;
      font-weight: bold;
      font-size: $LageFont;
    }

    li:nth-child(6) {
      margin-top: 20px;
    }

    li {
      width: 100%;
      height: 35px;
      line-height: 35px;
    }

    li:hover a {
      color: $PointColor;
      font-weight: bold;
    }

    li:first-child:hover a {
      color: #000;
    }
  }
}




/* SHEET MENU LIST BOX (중간영역)*/
.sht_box_1,
.sht_box_2,
.sht_box_3,
.sht_box_4 {
  display: flex;
  flex-direction: row;
  flex-wrap: wrap;
  align-content: flex-start;
  width: 13.3333%;
  height: 500px;
  padding: 30px 25px;
  box-sizing: border-box;


  li:first-child {
    height: 50px;
    font-weight: bold;
    font-size: $LageFont;
  }

  li {
    width: 100%;
    height: 35px;
    line-height: 35px;
  }

  li:hover a {
    color: $PointColor;
    font-weight: bold;
  }

  li:first-child:hover a {
    color: #000;
  }
}



/* SHEET MENU LIST BOX (영역사이 bar)*/
.bar_sht {
  width: 10%;
  height: 390px;
  box-sizing: border-box;
  margin: 40px 0;

  .bar_1:first-child {
    width: 50%;
    height: 100%;
    border-right: 1px solid #ccc;
    box-sizing: border-box;
  }

  .bar_2:first-child {
    width: 50%;
    height: 100%;
    border-right: 1px solid #ccc;
    box-sizing: border-box;
  }
}

.Men_bar_sht_1,
.Men_bar_sht_2 {
  height: 335px;
}

.Kids_bar_sht_1,
.Kids_bar_sht_1 {
  height: 415px;
}




.mainMenu_Sheet {
  display: none;
}

// .Women_sheet_box {display: none;}
// .Men_sheet_box {display: none;}
// .Kids_sheet_box {display: none;} 




/* BRAND BOX */
.Brand_sheet_box {
  background-color: #fff;
  display: flex;

  .Brand_outer {
    width: 20%;
    height: 500px;
    padding: 10px;
    box-sizing: border-box;

    a {
      display: block;

      img {
        width: 100%;
        height: auto;
        display: block;
      }

      p {
        width: 100%;
        height: 30px;
        line-height: 30px;
        text-align: center;
        font-weight: bold;
        padding-top: 15px;
      }
    }
  }
}

.hd_fix {
  position: fixed;
  top: 0;
  left: 0;
  background-color: $PointColor;
  z-index: 9999;
}







/* 타이틀 */
.join_main {
  width: 100%;
}
.join_main_box {
  width: 1440px;
  margin: 0 auto;
}
.join_main_box h1 {
  width: 200px;
  height: 100px;
  margin: 0 auto;
  text-align: center;
  line-height: 100px;
  box-sizing: border-box;
  margin-bottom: 50px;
}



/* 중간선 */
.join_bttn_bar {
  width: 600px;
  height: 2px;
  margin: 50px auto;  
  border-bottom: 1px solid #ccc;
}
.join_bttn_bar.black {
  border-bottom: 1px solid #000;
}
.join_bar_outer {
  width: 100%;
  float: left;
  margin-top: 110px;
  margin-bottom: 10px;
}
.middle_bar {
  margin-top: 0px;
}




/* 중간 타이틀 */
.join_title {
  width: 600px;
  height: 30px;
  margin: 0 auto;
  display: block;
}

.join_title h3{
  width: 300px;
  line-height: 30px;
  margin-bottom: 10px;
  text-align: left;
  float: left;
}
.join_title span {
  color: red;
  font-weight: bold;
  font-size: 14px;
  line-height: 30px;
  margin-bottom: 10px;
  float: right;
}
.title_terms {
  margin-bottom: 30px;
}
.doubleTit1{
  position: relative;
}
.doubleTit2 h3,
.doubleTit1 h3 {
  width: 150px;
}
.doubleTit1 span {
  position: absolute;
  right: 0;
  top: 0;
}
.doubleTit1 label,
.doubleTit1 input,
.doubleTit2 label,
.doubleTit2 input {
  margin-top: 10px;
  cursor: pointer;
}
.doubleTit1 label,
.doubleTit2 label {
  color: #888;
  font-weight: blod;
}
.doubleTit1 label:hover,
.doubleTit2 label:hover {
  color: #000;
}



/* 카카오 간편 */
.kakao_box {
  width: 600px;
  height: 110px;
  margin: 0 auto;
}
.kakao_box h4 {
  font-weight: normal;
}
.kakao_box input {
  display: none;
}
.kakao_box label {
  display: block;
  width: 600px;
  height: 60px;
  text-align: center;
  line-height: 60px;
  font-size: 18px;
  border-radius: 30px;
  background-color: rgb(255, 220, 0);
  background-image: url(./back_img/kakao_13x12.png);
  background-repeat: no-repeat;
  background-position-y: center;
  background-position-x: 23px;
  margin-top: 30px;
}




/* 본인인증 정보입력란 */
/* 필수정보 입력란 */
.join_box1,
.join_box2,
.join_box3,
.join_box4 {
  position: relative;
  width: 600px;
  height: 200px;
  margin: 0 auto;
  margin-top: 50px;
  display: flex;
}
.join_box1 {
  margin-top: 10px;
}
.join_box1 input,
.join_box2 input,
.join_box3 input,
.join_box4 input {
  display: flex;
  width: 600px;
  height: 50px;
  margin: 0 auto;
  border-radius: 5px;
  padding: 10px 15px;
  box-sizing: border-box;
  margin-bottom: 10px;
  outline: none;
  border: 1px solid #ccc;
}

.join_box2 {
  height: 240px;
}
.join_box3,
.join_box4 {
  height: 365px;
  margin-top: 10px;
}
.join_box4 {
  height: 300px;
}


.join_box2 input {
  margin-bottom: 25px;
}
#join_PostCode {
  width: 480px;
  margin: 0;
  margin-bottom: 10px;
}

.join_box1 #join_Tel1,
.join_box1 #join_Tel2 {
  width: 120px;
  height: 50px;
  outline: none;
  border: 1px solid #ccc;
  padding: 10px;
  color: #888;
  box-sizing: border-box;
  margin-right: 10px;
  border-radius: 5px;
}
.join_box1 #join_Tel3 {
  width: 335px;
  float: right;
}

.join_box1 #join_name,
.join_box1 #join_age {
  width: 480px;
  float: left;
  margin-right: 15px;
}

.join_box1 #join_gender,
.join_box1 #join_from {
  width: 105px;
  height: 50px;
  outline: none;
  margin-bottom: 10px;
  border: 1px solid #ccc;
